import React from "react";
import "./Card.css"
import IMAGES from "./images";

const Card = () => {
	return(
	<div class="card-deck">
		<div class="card">
			<img class="card-img-top" src={IMAGES.bookcover1} alt="text"/>
			<div class="card-body">
				<h5 class="card-title">Book Title</h5>
				<p class="card-text">Genre</p>
				<p class="card-text">Autor</p>
				<p class="card-text">Year Written</p>
				</div>
			  </div>
	</div>
	);
}

export default Card;
